import web3 from './web3';
import Campaign from './build/Crowdfunding.json';

const instance = new web3.eth.Contract(
  JSON.parse(Campaign.interface),
  '0x2a6A0115AcE3354b17f8fE99215Ac113Df899E3d'
);

export default instance;
